import React, {useState} from 'react'
import axios from 'axios'

export default function TestPost(){
    const [ticker,setTicker] = useState('')
    const [result,setResult] = useState(null)
    
    async function getRelativeVolume(){
        try{
        let res = await axios.post('http://localhost:8000/rvol',{ticker})
        setTicker(res.data)
        } catch(err){
            console.log(err)
        }
    }
    
    return (
        <>
        <label htmlFor='stock'></label>
        <input type='text' id='stock' value={ticker} onChange={e=>setTicker(e.target.value)}></input>
        <button onClick={()=>alert(ticker)}>Get RVOL</button>
        </>
    )
}
